import React from "react";
import Hero from "../components/Hero";

function AboutPage(props) {
  return (
    <div>
      <Hero title={props.title} />
      <content>
        <p>
          Hello, my name is Hanyue Shi. I'm a full-time student who is majoring
          in web design :){" "}
        </p>
        <p>
          I designed this website for my photo essay. I've been taught myself
          photography for more than three years, since I got my first camera
          from my dad.
        </p>
        <p>
          My dream is to become a software engineer and one day start my own
          photography studio as a side job.{" "}
        </p>
        <p>I mainly focus on still life photography and portrait, </p>
        <p>In the future, I will strive to create better works. </p>
      </content>
    </div>
  );
}

export default AboutPage;
